import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <h2>Rescue Radar</h2>
      <p>
        Our website predicts earthquake ,Flood and Tsunami severity using location data, provides
        educational resources on disaster management, and lists essential
        emergency contacts. 
         Our goal is to enhance preparedness and safety by combining
        advanced prediction technology with practical information and quick
        access to emergency services, all presented in a user-friendly interface.
      </p>
    </div>
  );
};

export default About;
